                  "choice": "Decisión: Se declara PARCIALMENTE HA LUGAR. Se ANULAN las sentencias dictadas por la Sala de Casación Social, bajo el Nro. 1236, del 16 de diciembre de 2015; el Juzgado Superior Tercero de Protección de Niños, Niñas y Adolescentes de la Circunscripción Judicial del Área Metropolitana de Caracas y Nacional de Adopción Internacional, del 19 de noviembre de 2013, y; el Juzgado Séptimo de Primera Instancia de Mediación, Sustanciación y Ejecución de Protección de Niños, Niñas y Adolescentes de la referida Circunscripción Judicial, del 1° de agosto de 2013. Se REPONE la causa al estado de abrir y tramitar la articulación probatoria a que se refiere los artículos 11 y 607 del Código de Procedimiento Civil, aplicados supletoriamente conforme el artículo 452 de la Ley Orgánica para la Protección de Niños, Niñas y Adolescentes, atendiendo al contenido de los escritos presentados el 3 de junio de 2013, actas de audiencias del 2 y 12 de julio de 2013, escritos del 12, 16 y 25 de julio de 2013 y los lineamientos del presente fallo y ORDENA a un Juzgado de Primera Instancia de Mediación, Sustanciación y Ejecución de Protección de Niños, Niñas y Adolescentes de la misma circunscripción judicial, que corresponda por distribución, proceda a obrar con conocimiento de causa, garantice el derecho a la prueba, control y contradicción y emita un pronunciamiento de fondo, en los términos expuestos en este fallo, previa notificación de las partes.",
