                  "choice": "Decisión: Se declara INADMISIBLE. Se AVOCA de oficio a la causa contenida en el expediente N° 20° C-S-1027-23 sustanciada por el Tribunal  (20°) de Primera Instancia en Funciones de Control del Circuito Judicial Penal del Área Metropolitana de Caracas. NULOS i) el acto de imputación formal de fecha 8 de agosto de 2023 contra la ciudadana Mariela Alejandra Reyes Hernández…y ii) el fallo de fecha 6 de septiembre de 2023, proferida por el precitado Juzgado (20°) de Primera Instancia en Funciones de Control de ese circuito judicial penal que declaró con lugar la medida cautelar innominada de restitución de inmueble. DECRETA EL SOBRESEIMIENTO DE LA PRESENTE CAUSA, a favor de la solicitante, de conformidad con el artículo 300 numeral 2º del Código Orgánico Procesal Penal, en consecuencia, se queda extinguida la acción penal. ORDENA remitir copia certificada del presente fallo a i) la Jueza Presienta del Circuito Judicial Penal del Área Metropolitana de Caracas y ii) al Fiscal General de la República, ciudadano Dr. Tarek William Saab, para que tenga conocimiento de la presente decisión y, en el marco de sus competencias, realice las investigaciones pertinentes ante la presunta comisión de hechos punibles y faltas disciplinarias. DECRETA ERROR JUDICIAL INEXCUSABLE a la Jueza YOLIMAR DUQUE MORALES, a cargo del Juzgado (20°) de Primera Instancia en Funciones de Control. ORDENA remitir copia certificada de la presente decisión al Ministerio Público, la Comisión Judicial, la Inspectoría General de Tribunales y al Colegio de Abogados de Caracas a los fines que en el marco de sus competencias inicien de ser el caso, una investigación y tomen las acciones penales y disciplinarias en contra la mencionada Jueza y notificar de la presente decisión a la ciudadana Mariela Sobeida Hernández González, al Fiscal Provisorio Sexto (6°) del Ministerio Público de la Circunscripción Judicial del Área Metropolitana de Caracas Moisés Alejandro García Velásquez, y a la Jueza Yolimar Duque Morales a cargo del prenombrado Juzgado. No firman la presente sentencia las magistradas Dra. Lourdes Benicia Suárez Anderson y Michel Adriana Velasquez Grillet,  por motivos justificados.",
                  "speaker": "Ponente: Luis Fernando Damiani Bustillos",
                  "url_content": "http://historico.tsj.gob.ve/decisiones/scon/febrero/332428-0073-6224-2024-23-0968.HTML"
