                  "parts": "Partes: Banco de Comercio Exterior, C.A. (BANCOEX) interpone demanda por cumplimiento de contrato de crédito para adquisición de activos fijos conjuntamente con medida cautelar innominada contra la sociedad mercantil Corporación Inveca, C.A. (X-2022-0005).",
                  "choice": "Decisión: La Sala declara: -PROCEDENTE la medida cautelar de prohibición de enajenar y gravar sobre los bienes inmuebles situados en la República Bolivariana de Venezuela pertenecientes a la sociedad mercantil CORPORACIÓN INVECA, C.A. -PROCEDENTE la medida cautelar innominada consistente en la prohibición de enajenar las acciones pertenecientes a dicha sociedad de comercio. -PROCEDENTE la medida cautelar consistente en la designación de una Junta Administradora Ad Hoc sobre la empresa CORPORACIÓN INVECA, C.A. -PROCEDENTE la designación de un Veedor Judicial a la sociedad mercantil previamente indicada.",
