                  "choice": "Decisión: La Sala declara: -PRESCRITA LA EJECUTORIA de la sentencia Nro. 0256, de fecha 13 de agosto de 1985, dictada por la Sala Político-Administrativa, que fijó el monto de la indemnización que la entonces República de Venezuela debía pagar a la empresa Lancashire General Investment Company Limited por la expropiación de una extensión de terreno de su propiedad, de veintitrés mil quinientos setenta y cuatro metros cuadrados (23.574 M2), en la cantidad para ese entonces de un millón novecientos ochenta mil doscientos dieciséis bolívares sin céntimos  (Bs. 1.980.216,00), que resultó afectado para la construcción de la Autopista El Palito-Puerto Cabello del Estado Bolivariano de Carabobo, únicamente en lo que respecta al pago del justiprecio, sin perjuicio de las diligencias que deba llevar a cabo la República para el traslado de la propiedad. -TERMINADO EL PROCEDIMIENTO.",
                  "speaker": "Ponente: Malaquías Gil Rodríguez",
                  "url_content": "http://historico.tsj.gob.ve/decisiones/spa/agosto/337262-00626-14824-2024-1976-1548.HTML"
