                  "choice": "Decisión: La Sala declaró: 1.- ACEPTA LA COMPETENCIA DECLINADA por la Corte Primera de lo Contencioso Administrativo, mediante Sentencia N° 2001-556 de fecha 17 de abril de 2001, en consecuencia, se declara COMPETENTE para conocer del recurso interpuesto por los abogados Alberto Rivas Sánchez, Héctor Briceño Díaz, Glenys Yadira Ruiz Rojas, Orlando Antonio Torres, Nancy García Fermín, Yolanda Hernández de Díaz, Ramón Alejandro Infante, José Gregorio Dibe Mahlus, Orlando Santoro Scatollini, Alicia Velasco Viso y Dagmar Xiomara Ramírez Ruiz, titulares de las Cédulas de Identidad Nros. V-10.279.874, V-628.916, V-8.678.441, V-4.052.213, V-6.719.916, V-3.589.312, V-3.586.947, V-9.488.823, V-8.677.345, V-6.814.485 y V-6.110.605 respectivamente, inscritos en el Inpreabogado bajo los Nros. 50.753, 3.238, 46.910, 16.972, 54.107, 21.957, 20.558, 43.656, 41.120, 38.553 y 30.498, en su orden, en el alegado carácter de litisconsortes en el presente procedimiento, contra los “…actos de: Elección y nombramiento de la Comisión Electoral, Proceso de Solventación y elaboración de listado de electores, Acto de Votación, Escrutinios, Totalización, Adjudicación y Proclamación, realizados con ocasión a las elecciones de la Junta Directiva, Tribunal Disciplinario y Fiscal del Colegio de Abogados del estado Miranda, para el período 1.997-1.999, celebradas en fecha 6 de diciembre de 1.996…”.\n2.- Declara El DECAIMIENTO DEL OBJETO del recurso contencioso anteriormente de nulidad, ahora electoral, conjuntamente con medidas cautelares de suspensión de efectos interpuesto contra la Junta Directiva del Colegio de Abogados del estado Bolivariano de Miranda.",
