                  "parts": "Partes: El abogado JOSÉ ELADIO QUINTERO MARQUINA, titular de la cédula de identidad N° 2.457.398, inscrito en el Inpreabogado bajo el N° 7318, actuando en su propio nombre en su alegado carácter de profesor jubilado de la Universidad de los Andes (ULA), interpuso acción de amparo constitucional contra el Consejo Universitario de la referida Universidad, ante la inminente aprobación del Reglamento Electoral Transitorio para elegir Autoridades y Decanos.",
