                  "parts": "Partes: Por recibido oficio Nro. 038-C de fecha 05 de marzo de 2024, emanado del Juzgado Superior Estadal Contencioso Administrativo de la Circunscripción Judicial de estado Monagas, anexo al cual remitió expediente signado con el alfanumérico Nro. NP11-G-2024-000001 contentivo del recurso contencioso electoral con amparo cautelar ejercido por los ciudadanos ALFREDO LÓPEZ y MARITZA AGREDA, titulares de las cédulas de identidad Nros. V-17.933.774 y V-9.291.876, respectivamente, en el alegado carácter de propietarios de inmuebles ubicados en la Urbanización \"Lomas del Bosque\" ubicadas en la ciudad de Maturín estado Monagas, asistidos por el abogado William Eduardo Núñez Véliz, inscrito en el Inpreabogado bajo el Nro. 44.987, contra la Junta Administradora del Macro Condominio de la Urbanización \"Lomas del Bosque\", remisión que se efectuó en virtud de la decisión dictada en fecha 22 de febrero de 2023, conforme a la cual declinó el presente asunto en esta Sala.",
