                  "parts": "Partes: Los Abogados  JUAN DOMINGO ALFONZO PARADISI y JUAN ANDRÉS MIRALLES QUINTERO,  inscritos en el Inpreabogado bajo los N° 28.681 y 304.868, actuando en el alegado carácter de Apoderados Judiciales de las sociedades mercantiles FIBRANOVA, C.A, OXINOVA, C.A, TERRANOVA DE VENEZUELA y ANDINOS, C.A, respectivamente, interponen demanda contencioso electoral de nulidad conjuntamente con solicitud de medida cautelar innominada de suspensión de efectos, contra el supuesto proceso de elecciones de los miembros de la Junta Directiva y demás autoridades del Sindicato de Industrias de Trabajadores de Empresas Manufactureras de Madera y sus Similares (SITRAEMAS) celebrado en fecha 01 de agosto de 2023.",
