                  "choice": "Decisión: (...)Quinto: Se hace constar categóricamente que los ciudadanos Manuel Rosales, representante de Un Nuevo Tiempo (UNT), José Luis Cartaya, representante de la Mesa de la Unidad Democrática (MUD) y José Simón Calzadilla, representante de Movimiento por Venezuela (MPV), todos miembros de la Alianza Plataforma Unitaria Democrática y postulantes del excandidato Edmundo González Urrutia; no consignaron material electoral alguno, argumentando que no poseen ningún tipo de documentación referida a este proceso electoral, en tal sentido, manifestaron que no tienen actas de escrutinio de los testigos de las mesas, ni listados de testigos, aduciendo además que no participaron en el proceso de traslado y resguardo de material alguno. Igualmente, señalaron que la organización SUMATE es parte del equipo asesor técnico de la Alianza Plataforma Unitaria Democrática, y a su vez desconocieron quien o quienes realizaron la carga de la información de las presuntas actas de escrutinio en la página web www.resultadospresidencialesvenezuela2024.com, la cual está siendo objeto de investigación de oficio por parte del Fiscal General de la República Dr. Tarek William Saab, quien ordenó “…abrir una investigación de carácter penal para determinar las responsabilidades del caso, ante la zozobra causada en la población por la presunta comisión de los delitos de usurpación de funciones, forjamiento de documento público, instigación a la desobediencia de las leyes, delitos informáticos, asociación para delinquir y conspiración…”.\nEn consecuencia, habiendo sido recolectados los instrumentos electorales de los distintos factores participantes en el proceso de Elecciones Presidenciales celebrado el 28 de julio de 2024; los Magistrados de esta Sala Electoral se abocan al PERITAJE de todo el material electoral de valor probatorio consignado en físico y/o digital, así como también al PERITAJE sobre el ataque cibernético masivo del que fue objeto el sistema electoral venezolano, para lo cual esta Sala contará con un personal altamente calificado e idóneo que hará uso de los más altos estándares técnicos, garantizando así esta Máxima Instancia Judicial a todos los ciudadanos y ciudadanas que resolveremos soberanamente los conflictos que competen de manera exclusiva al Estado venezolano, por lo tanto esta Sala Electoral continua con el peritaje iniciado el 5 de agosto de 2024, a los fines de producir la SENTENCIA DEFINITIVA que dé respuesta al presente recurso, la cual tendrá carácter de cosa juzgada, por ser este órgano jurisdiccional la máxima instancia judicial en materia electoral, por lo que sus decisiones son inapelables y de obligatorio acatamiento. \nEl Tribunal Supremo de Justicia de la República Bolivariana de Venezuela, considera oportuno reiterar el compromiso y la voluntad ante el pueblo venezolano de impartir justicia, por lo que nada nos detendrá en nuestra sagrada misión.",
