                  "parts": "Partes: Presidente Constitucional de la República Bolivariana de Venezuela NICOLÁS MADURO MOROS.",
                  "choice": "Decisión: Visto que los días 7, 8 y 9 de agosto de 2024 en este Órgano Jurisdiccional se efectuaron las audiencias orales de los representantes de los partidos políticos así como de los excandidatos, según el cronograma establecido mediante sentencia de fecha 5 de agosto de 2024, ratificado el 6 del mismo mes y año, en la que debían consignar todos los instrumentos electorales que poseen y que fuesen de relevancia jurídica relacionados con el proceso de Elecciones Presidenciales celebrado el 28 de julio de 2024, esta Sala Electoral pasa a realizar las siguientes consideraciones: \nPrimero: Se reitera que el Consejo Nacional Electoral como Órgano Rector y máxima autoridad del Poder Electoral en la República Bolivariana de Venezuela, compareció en pleno con todos sus Rectores y Rectoras Principales encabezado por su Presidente Dr. Elvis Eduardo Hidrobo Amoroso, dando cumplimiento a cabalidad con el requerimiento formulado por esta Sala Electoral del Tribunal Supremo de Justicia, al consignar oportunamente y en tiempo hábil todos los recaudos vinculados con el proceso electoral. \nSegundo: Se deja constancia que fueron legalmente citados treinta y ocho (38) representantes de las organizaciones políticas así como los diez (10) excandidatos que participaron en los comicios presidenciales, sumando un total de cuarenta y ocho (48) ciudadanos, convocados a comparecer en esta instancia judicial. \nTercero: En atención a las referidas citaciones, acudieron oportunamente las treinta y ocho (38) organizaciones políticas postulantes, consignando treinta y tres (33) de ellas el material electoral requerido, siendo éstas las siguientes: Primero Venezuela, Movimiento Primero Justicia, Unión Visión Venezuela, Venezuela Unidad, Acción Democrática (AD), COPEI, Movimiento Republicano, Bandera Roja, Derecha Democrática Popular, Unión Nacional Electoral, Voluntad Popular, Alianza Política Asamblea Renovación y Esperanza (AREPA), Esperanza por el Cambio, Soluciones Para Venezuela, Min Unidad, Cambiemos, Avanzada Progresista, Movimiento Ecológico de Venezuela, Fuerza Vecinal, Confederación Nacional Democrática (CONDE), Partido Socialista Unido de Venezuela (PSUV), TUPAMARO, Patria Para Todos (PPT), Movimiento Somos Venezuela, Organización Renovadora Auténtica (ORA), Por la Democracia Social (PODEMOS), Partido Verde, Enamórate Venezuela, Movimiento Electoral del Pueblo (MEP), Partido Futuro Venezuela, Partido Comunista de Venezuela (PCV), Unidad Popular Venezolana (UPV) y Alianza Para El Cambio. \nDe igual forma, de los diez (10) excandidatos citados, acudieron nueve (9) de ellos, a saber: los ciudadanos Antonio Ecarri, Enrique Márquez, José Brito, Luis Eduardo Martínez, Daniel Ceballos, Javier Bertucci, Claudio Fermín, Benjamín Rausseo y el Presidente Nicolás Maduro Moros. \nPor otra parte, se deja constancia que las organizaciones políticas Alianza al Lápiz y Movimiento Centrados Para la Gentes, no consignaron el material electoral requerido, así como tampoco lo hicieron los excandidatos Antonio Ecarri y Enrique Márquez.\nCuarto: Se deja constancia que el excandidato Edmundo González Urrutia, NO ASISTIÓ y por tanto NO CUMPLIÓ con la orden de citación, desacatando con su inacción el mandato de esta, la más Alta Instancia de la Jurisdicción Contencioso Electoral de la República Bolivariana de Venezuela. En consecuencia NO CUMPLIÓ con la consignación de las actas de escrutinios, el listado de testigos ni material electoral alguno.",
