                  "parts": "Partes: Jennifer Milagros Castillo Rebolledo.",
                  "choice": "Decisión: PRIMERO: PROCEDENTE LA SEGUNDA FASE DEL AVOCAMIENTO SOLICITADO.-SEGUNDO: SE ORDENA dar cumplimiento a las ordenes de sustanciación de los distintos procesos judiciales dada en este fallo, al Tribunal de Primera Instancia de Mediación, Sustanciación y Ejecución del Circuito Judicial de Protección de Niños, Niñas y Adolescentes de la Circunscripción Judicial del Área Metropolitana de Caracas y Nacional de Adopción Internacional, que corresponda por distribución, a los fines de que UN SÓLO JUEZ CONOZCA, SUSTANCIE Y DECIDA el cúmulo de procesos judiciales e incidencias que estén pendientes y que afectan al niño sujeto de los mismos.- TERCERO: SE ANULA Y DEJA SIN EFECTO JURÍDICO ALGUNO, la decisión dictada por el Tribunal Décimo (10°) de Primera Instancia de Mediación, Sustanciación y Ejecución del Circuito Judicial de Protección de Niños, Niñas y Adolescentes de la Circunscripción Judicial del Área Metropolitana de Caracas y Nacional de Adopción Internacional, en fecha 18 de enero de 2017, QUEDANDO REVOCADA la medida de prohibición de salida del país, decretada en contra del niño F.A.N.C. (cuya identidad se omite conforme a lo estatuido en el artículo 65 parágrafo segundo de la Ley Orgánica para la Protección de Niños, Niñas y Adolescentes), y a su señora madre, ciudadana JENNIFER MILAGROS CASTILLO REBOLLEDO, de nacionalidad venezolana, mayor de edad y titular de la cédula de identidad N° V-15.338.101, y en consecuencia SE ORDENA NOTIFICAR MEDIANTE OFICIO LA PRESENTE DECISIÓN DEL LEVANTAMIENTO DE LA MEDIDA, a los ciudadanos Director del Servicio Administrativo de Identificación, Migración y Extranjería (S.A.I.M.E.), adscrito al Ministerio del Poder Popular para Relaciones Interiores, Justicia y Paz, así como al ciudadano Director del Instituto Aeropuerto Internacional de Maiquetía (I.A.I.M.), responsable del manejo del Aeropuerto Internacional Simón Bolívar, adscrito al Ministerio del Poder Popular para el Transporte.- Finalmente LA SALA ADVIERTE a los ciudadanos jueces involucrados en este proceso judicial y a los funcionarios públicos señalados, que el incumplimiento de lo aquí decidido y ordenado, dará lugar a multa equivalente hasta doscientas (200) veces el tipo de cambio oficial de la moneda de mayor valor, establecido por el Banco Central de Venezuela, sin perjuicio de las sanciones penales, civiles, administrativas o disciplinarias a que hubiere lugar, en conformidad con lo estatuido en el artículo 122 de la Ley Orgánica del Tribunal Supremo de Justicia.- No hay imposición en costas procesales, dada la naturaleza excepcional del presente procedimiento de AVOCAMIENTO y de la presente decisión.- Publíquese, regístrese y notifíquese. Cúmplase lo ordenado en este fallo.- Remítanse los expedientes a los fines de que se dé cumplimiento a las órdenes dadas en esta sentencia, al Tribunal de Primera Instancia de Mediación, Sustanciación y Ejecución del Circuito Judicial de Protección de Niños, Niñas y Adolescentes de la Circunscripción Judicial del Área Metropolitana de Caracas y Nacional de Adopción Internacional, que corresponda por distribución.",
                  "speaker": "Ponente: Edgar Gavidia Rodríguez",
