                  "sentence_number": "037",
                  "proceedings_number": "23-203",
                  "proceedings_type": "Procedimiento: Avocamiento",
                  "parts": "Partes: Williams Rafael Cedeño Urbano contra Tucan Petroleum Services, C.A. Tercero Opositor Solicitante: Ferreoriente El Tigre, C.A.",
                  "choice": "Decisión: PRIMERO: PROCEDENTE LA SEGUNDA FASE DEL AVOCAMIENTO.\nSEGUNDO: SE DECLARA LA NULIDAD ABSOLUTA Y SE DEJA SIN EFECTO JURÍDICO ALGUNO, todas las actuaciones habidas en la causa principal a partir del auto de fecha 15 de febrero de 2013, inclusive, dictado por el Juzgado Sexto de Primera Instancia de Sustanciación, Mediación y Ejecución del Trabajo de la Circunscripción Judicial del estado Anzoátegui, extensión territorial y sede en la ciudad de El Tigre, en el cual se decretó la ejecución forzosa del monto restante, y decretó embargo ejecutivo sobre bienes de la demandada, con exclusión de la sentencia de esta Sala N° 1290, de fecha 8 de diciembre de 2016, expediente N° 2015-1338. TERCERO: SE REPONE la presente causa al estado de que una vez recibido el expediente en el tribunal de primera instancia, y cumplido el procedimiento previo para la citación de los herederos, SE PROCEDA A LA APERTURA DE UNA INCIDENCIA DE EJECUCIÓN, en conformidad con lo previsto en los artículos 533 y 607 del Código de Procedimiento Civil, aplicables por remisión de lo dispuesto en el artículo 11 de la Ley Orgánica Procesal del Trabajo, y se determine en definitiva, si el bien objeto de ejecución es propiedad o no del demandado contra quien pretende obre la ejecutoria, y decidida dicha incidencia se continúe con la tramitación de la causa en los términos que corresponda. CUARTO: SE ORDENA dar estricto cumplimiento a la orden de sustanciación de este proceso judicial dada en este fallo, al Juez de Primera Instancia de Sustanciación, Mediación y Ejecución del Trabajo de la Circunscripción Judicial del estado Anzoátegui, extensión territorial y sede en la ciudad de El Tigre, que corresponda por distribución, a quien se ordena siga conociendo del caso, quedando separado del caso el juez del Tribunal Sexto de Primera Instancia de Sustanciación, Mediación y Ejecución del Trabajo de la misma Circunscripción Judicial. QUINTO: LA SALA ADVIERTE a los funcionarios públicos señalados como involucrados en este proceso, que el incumplimiento de lo aquí decidido y ordenado, dará lugar a multa equivalente hasta doscientas (200) veces el tipo de cambio oficial de la moneda de mayor valor, establecido por el Banco Central de Venezuela, sin perjuicio de las sanciones penales, civiles, administrativas o disciplinarias a que hubiere lugar, en conformidad con lo estatuido en el artículo 122 de la Ley Orgánica del Tribunal Supremo de Justicia.- SEXTO: Remítase copia certificada del presente fallo a la Inspectoría General de Tribunales, a los fines legales consiguientes. NO SE HACE IMPOSICIÓN DE COSTAS PROCESALES, A LAS PARTES CONTENDIENTES, dada la naturaleza excepcional del presente fallo y del procedimiento.\nPublíquese y regístrese. Cúmplase lo ordenado en este fallo.\nRemítase el expediente al Juez de Primera Instancia de Sustanciación, Mediación y Ejecución del Trabajo de la Circunscripción Judicial del estado Anzoátegui, extensión territorial y sede en la ciudad de El Tigre, que corresponda por distribución, a los fines de que dé cumplimiento a las órdenes dadas en esta sentencia. Particípese de la remisión del expediente al Juzgado Sexto de Primera Instancia de Sustanciación, Mediación y Ejecución del Trabajo de la Circunscripción Judicial del estado Anzoátegui, extensión territorial y sede en la ciudad de El Tigre.",
                  "speaker": "Ponente: Edgar Gavidia Rodríguez",
                  "url_content": "http://historico.tsj.gob.ve/decisiones/scs/marzo/333160-037-19324-2024-23-203.HTML"
