                  "choice": "Decisión: PRIMERO: PROCEDENTE LA SEGUNDA FASE DEL AVOCAMIENTO. SEGUNDO: ANULA el particular quinto del dispositivo de la sentencia dictada en fecha 27 de febrero de 2020 por el Juzgado Superior de Protección de Niños, Niñas y Adolescentes de la Circunscripción Judicial del estado Carabobo, con sede en Valencia, en la cual se ordenó oficiar al Ministerio Público y al Consejo Nacional Electoral en su Coordinación Regional de Registros Civiles en materia de identificación de ese estado; así como los oficios alfanuméricos JMS1-2021-0091 y JMS1-2021-0092, librados por el Juzgado Primero de Primera Instancia de Mediación, Sustanciación y Ejecución de Protección de Niños, Niñas y Adolescentes de dicha Circunscripción Judicial, con sede en Puerto Cabello, a dichos organismos respectivamente, y el pronunciamiento contenido en la “aclaratoria del pronunciamiento de fecha” 26 de abril de 2021, proferida el 25 de mayo de 2021 por este último Tribunal, relacionada con la orden de librar los señalados oficios en razón de la doble inscripción del infante. TERCERO: ORDENA EL CUMPLIMIENTO DEL RÉGIMEN DE CONVIVENCIA FAMILIAR PROVISIONAL, en los términos establecidos mediante decisión de fecha 26 de abril de 2021, dictada por el Tribunal Primero de Primera Instancia de Mediación, Sustanciación y Ejecución de Protección de Niños, Niñas y Adolescentes de la Circunscripción Judicial del estado Carabobo, con sede en Puerto Cabello, con las modificaciones efectuadas por el Tribunal Tercero Accidental de Primera Instancia de Mediación, Sustanciación y Ejecución de Protección de Niños, Niñas y Adolescentes de la nombrada Circunscripción Judicial, en fechas 8 de febrero y 6 de diciembre de 2022. CUARTO: ORDENA EL DESGLOSE de las piezas anexas correspondientes al expediente identificado con el alfanumérico AA60-S-2022-000181, nomenclatura de este Alto Tribunal, contentivas de los expedientes judiciales alfanuméricos JMS1-S-0183-19, contentivo de solicitud de divorcio por desafecto y JMS1-S0-212-21, contentivos de la solicitud de nulidad de acta de nacimiento. QUINTO: SE ORDENA LA REMISIÓN de los expedientes antes mencionados al Tribunal Tercero Accidental de Primera Instancia de Mediación, Sustanciación y Ejecución de la Circunscripción Judicial del estado Carabobo, con sede en Puerto Cabello, a los fines de la prosecución de las causas que fueran suspendidas temporalmente por esta Sala mediante sentencia No. 284, de fecha 14 de diciembre de 2022, la cual declaró la admisión de la primera fase del avocamiento. SEXTO: SE ORDENA LA REMISIÓN de una copia certificada de la presente decisión al Juzgado Primero de Primera Instancia de Mediación, Sustanciación y Ejecución de Protección de Niños, Niñas y Adolescentes de la Circunscripción Judicial supra mencionada. SÉPTIMO: SE ORDENA el cierre y archivo del expediente principal contentivo de la presente solicitud de avocamiento. Dada la naturaleza especial y extraordinaria del avocamiento, no hay condenatoria en costas. Publíquese, regístrese y remítase los expedientes a la Unidad de Recepción y Distribución de Documentos de la Circunscripción Judicial del estado Carabobo. Particípese de esta remisión a los Juzgados de origen, a los fines legales consiguientes. Remítase copia certificada de la presente decisión a la Fiscalía Superior del Ministerio Público del estado Carabobo y a la Coordinación Regional de Registro Civil en materia de identificación del Consejo Nacional Electoral del mencionado estado para su conocimiento.",
                  "speaker": "Ponente: Elias Ruben Bittar Escalona",
                  "url_content": "http://historico.tsj.gob.ve/decisiones/scs/mayo/334799-169-30524-2024-22-181.HTML"
