                  "proceedings_type": "Procedimiento: Recurso de Hecho",
                  "parts": "Partes: Davey Pérez Cordero contra Francisco Bacile Ricciardella.",
                  "choice": "Decisión: SIN LUGAR el recurso de hecho propuesto  por la parte accionada ciudadano DAVEY PÉREZ CORDERO contra el auto de fecha 26 de abril de 2023, dictado por el Juzgado Superior de Protección de Niños, Niñas y Adolescentes de la Circunscripción Judicial del estado Yaracuy, denegatorio del recurso de casación anunciado contra la sentencia de fecha 17 de abril de 2023, dictada por el referido juzgado superior. Se condena a los recurrentes al pago de las costas, de conformidad con el artículo 61 Ley Orgánica Procesal del Trabajo aplicable por remisión de expresa del artículo 452 de Ley Orgánica para la Protección del Niños, Niñas y Adolescentes. Publíquese, regístrese y remítase el expediente a la Unidad de Recepción y Distribución de Documentos de la Circunscripción Judicial supra identificada. Particípese de esta remisión al Juzgado Superior de origen, antes mencionado, de conformidad con lo establecido en el 489-I de la Ley Orgánica para la Protección de Niños, Niñas y Adolescentes.",
                  "speaker": "Ponente: Edgar Gavidia Rodríguez",
