                  "parts": "Partes: Marvis Elvira Allais León contra Paul Edward Maurette O´Brien.",
                  "choice": "Decisión: Acuerda solicitar a la Jueza Coordinadora del Circuito Judicial de Protección de Niños, Niñas y Adolescentes de la Circunscripción Judicial del Área Metropolitana de Caracas, se sirva informar a esta Sala de Casación Social, si contra la decisión dictada el 21 de mayo de 2024 por el Juzgado Superior Quinto de Protección de Niños, Niñas y Adolescentes de la Circunscripción Judicial del Área Metropolitana de Caracas y Nacional de Adopción Internacional, en el asunto signado con el alfanumérico AP51-O-2024-003773, por motivo de amparo constitucional, interpuesto por la representación judicial de la ciudadana Marvis Elvira Allais León, fue ejercido algún tipo de recurso, o si por el contrario la misma se encuentra definitivamente firme, ello a los fines que esta Sala de Casación Social, pueda dictar el pronunciamiento que a bien tenga, en relación al asunto sometido a su consideración. Para tales efectos, se solicita se sirva remitir copia de la sentencia de amparo y actuaciones posteriores. Con base en los argumentos anteriormente expuestos, esta Sala ordena notificar, a través de los medios telemáticos conforme a lo dispuesto en el artículo 85 de la Ley Orgánica de Reforma de la Ley Orgánica del Tribunal Supremo de Justicia, a la Dra. Joselyn Fernández Amoroso, Jueza Coordinadora del Circuito Judicial de Protección de Niños, Niñas y Adolescentes de la Circunscripción Judicial del Área Metropolitana de Caracas y Nacional de Adopción Internacional, para que dentro del lapso de tres (3) días de despacho, de cumplimiento a lo ordenado en la presente decisión. Publíquese, regístrese y notifíquese. Cúmplase lo ordenado.",
                  "speaker": "Ponente: Carlos Alexis Castillo Ascanio",
                  "url_content": "http://historico.tsj.gob.ve/decisiones/scs/agosto/336260-372-7824-2024-24-097.HTML"
