                  "choice": "Decisión: PRIMERO: INADMISIBLE el recurso extraordinario de control de la legalidad interpuesto por la representación judicial de los codemandados, contra la sentencia dictada el 23 de octubre de 2023, por el Juzgado Superior de Protección de Niños, Niñas y Adolescentes de la Circunscripción Judicial del estado Táchira, con sede en la ciudad de San Cristóbal. SEGUNDO: SE RECONDUCE el medio de impugnación interpuesto al trámite procesal correspondiente al recurso extraordinario de casación, de conformidad con el artículo 492 de la Ley Orgánica para la Protección de Niños, Niñas y Adolescentes. TERCERO: SE ADMITE el recurso extraordinario de casación, de conformidad con el artículo 489 de la ley especial en comento. En consecuencia, SE ORDENA la notificación de las partes que integran el presente juicio, en la persona de sus respectivos apoderados judiciales, y una vez conste en autos la última de las notificaciones de que se trate, comenzará a correr el término de la distancia de nueve (9) días consecutivos correspondiente entre la ciudad de San Cristóbal y la ciudad de Caracas, sede del Alto Tribunal de la República, y subsecuentemente, comenzará a computarse el lapso de veinte (20) días consecutivos para que la parte recurrente consigne el escrito de formalización del recurso extraordinario de casación ante la Secretaría de esta Sala de Casación Social, de conformidad con el artículo 489-D eiusdem. Publíquese, regístrese. Cúmplase con lo ordenado.",
